import { useState, useRef, useEffect } from "react";

const Movie = ({ item }) => {
  return (
    <div className="one_movie">
      <img src={item.image} alt="" />
      <h2>{item.titleLtu}</h2>
      <p>{item.genre}</p>
      <div>{item.imdbRating}</div>
      <h4>Duration: {item.duration}</h4>
    </div>
  );
};

export default Movie;
